import React from "react";
import Row from "react-bootstrap/Row";

const SingleData = (props) => {
  return (
    <Row style={{ margin: "auto", borderBottom: "0.5px solid #c2c2c2" }}>
      <h4>{props.date}</h4>
      <h4>{props.value}</h4>
    </Row>
  );
};

export default SingleData;
